$(function() {
    $(".carousel").carousel({
        interval: 3e3
    }), $(".lightbox").magnificPopup({
        type: "image"
    }), $(".map-canvas").each(function() {
        var a = new GMaps({
            div: $(this).attr("id"),
            lat: $(this).data("latitude"),
            lng: $(this).data("longitude")
        });
        a.addMarker({
            lat: $(this).data("latitude"),
            lng: $(this).data("longitude"),
            title: $(this).data("markertitle")
        });
    });
});